import React from "react"

export const Grid = (arr) => {

    return(
        <>
            {arr.map((row, rowId) => {
                return(
                    <div key="rowId">
                        {row.map((node) => {
                            return node
                        })}
                    </div>
                )
            })}
        </>
    )
}
